import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import '../../pages/Aboutme/Aboutme.css'


const useStyles = makeStyles(theme => ({
    Maintitle: {
      fontSize: "6em",
      fontFamily: "'Raleway', sans-serif",
      // textAlign: "left",
      paddingTop: "1em",
      paddingBottom: "1em",
      // textShadow: "#4a4a4a 1px 1px 4px",
      textShadow: "#000 2px 1px 1px",


      [theme.breakpoints.down('xs')]: {
        fontSize: "5em",
        fontFamily: "'Raleway', sans-serif",
        // textAlign: "left",
        paddingTop: "1em",
        paddingBottom: "1em",
      },
      // [theme.breakpoints.up('md')]: {
      // },
      // [theme.breakpoints.up('lg')]: {
      // },
    },

    Maintitle_sub:{
      fontSize: "2em",
      fontFamily: "''Lato', sans-serif",

      [theme.breakpoints.down('xs')]: {
        fontSize: "1em",
      },
    }
  }))

  function Welcome(props) {
    const classes = useStyles();

    return (
      <div >
        <div className="Page">
          <h1 className={classes.Maintitle}>Hello! I'am Tiziano</h1>
          <h2 className={classes.Maintitle_sub}>Software Engineer ║ IT Business Analyst ║ Developer</h2>
        </div>
    </div>
    )
  }

  export default Welcome;
